import React, {useRef} from 'react';
import PropTypes from 'prop-types';


import Slider, { Range } from 'rc-slider';
// We can just import Slider or Range to reduce bundle size
// import Slider from 'rc-slider/lib/Slider';
// import Range from 'rc-slider/lib/Range';
import 'rc-slider/assets/index.css';


import volume from '../../assets/images/svg/volume.svg';




const PlayPanelVolume = props => {

    return (
        <div className="jp-volume-controls flex-item">

            <div className="slider" id="colorpicker">

                <Slider />
            </div>



            <div className="widget knob-container">
                <div className="knob-wrapper-outer">
                    <img src={volume} alt="" />
                </div>
            </div>
        </div>
    );
};

PlayPanelVolume.propTypes = {

};

export default PlayPanelVolume;
